import { Routes, Route } from "react-router-dom";
import AccountLayout from "./Layouts/Account/AccountLayout";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<AccountLayout />}></Route>
      </Routes>
    </>
  );
}

export default App;
